function 系統初始(){
    this.版本= new 版本參數設定();
    this.系統=new 系統參數();
    this.運行=new 運行參數設定();
}


function 版本參數設定(){
    this.範疇="測試版"; //測試版,大眾版,專業版,私人版
    this.版本號 = "v0.4";
    this.版本顯示 = this.版本級別 + this.版本號;
    this.平台標題 = "紫 芸 居 - 八 字 排 盤";
    this.中標題 = "技術提供:";
    this.中標題內容 = "&copy紫芸居";
}

function 系統參數(){
    this.userid="";
    this.mode={"activated": true, "engineering": true};
    this.device="";
    this.brower="";
    this.screensize=0;
    this.inputdate = "";  //輸入的生日，轉換前的日期，non date format
    this.calcdate = "";   //輸入的生日，轉換後的日期, date format
    this.momentdate = "";
    this.timezone = "";
    this.now = new Date();
    this.HeaderImg="data:image/png;base64,";
    this.BodyImg="data:image/png;base64,";
}

function 運行參數設定(){
    this.mode={"activated": true, "engineering": false};
    this.Access = 9; //0:過期,只有排盤；1：大眾: 排盤+命盤數據；5：專業/紫芸居；9：內部
    this.大運激活=true; 
    this.流年激活=true;
    this.流月激活=true;
    this.起始=true; //initialization stage, not started counting anything yet
    this.expiry = new Date(2015, 11, 30);
}
